Велосипед 20" дюймів 2-х колісний "CORSO Revolt" MG-20920
Модель Corso Magnesium 20" за рахунок магнієвої рами, магнієвих дисків, магнієвої вилки має дуже легку вагу, в порівнянні з велосипедами на сталевій рамі, різниця приблизно становить від 3 до 4 кілограмів залежно від моделі велосипеда.
Суперлегка магнієва рама, литі магнієві диски, дискові гальма, комплектація якісним обладнанням!
Призначений для дітей віком від 8 до 10 років від 115 см до 130 см.
Характеристики:
- суттєво легка вага;
- переднє і заднє ручне дискове механічне гальмо;
- зручні якісні грипси керма (гумові ручки на кермі);
- ексклюзивний дизайн "CORSO";
- унікальне матове та глянцеве фарбування;
- м`яке, комфортне сидіння з матового та глянцевого матеріалу;
- литі магнієві диски 20”;
- винос керма 45мм алюмінієвий;
- Кермо сталеве;
- безрізьбова каретка Американського типу;
- Дзвіночок на кермі.
- Підніжка.
Маса Нетто: 10 кг
Вага Брутто: 12.2 кг.
